import React from 'react';
import './Home.css';

class Home extends React.Component {
    constructor() {
        super();
    }
    render(){
        return (
            <>
            <div className='container'>
                <div className='row'>
                    <div className='col-12'>
                         <h1> MUCHEN APPS </h1>
                         <hr/>
                        <h4>Rp.1.500.00,-</h4>
                        <span>Uang kamu tersisa 75% lagi</span>
                 </div>
             </div>

             <div className='row'>
                <div className='col-6'>
                    <div className='icon-wrapper'>
                    <i class="bi bi-wallet2"></i>
                    </div>
                </div>
             </div>
        </div>
        </>  
        )
    }
}

export default Home;
